function sticky() {
  const scroll = jQuery(window).scrollTop();

  if (scroll >= 20) {
    $('.header')
      .removeClass('dark-bg')
      .addClass('fixed');
  } else {
    $('.header')
      .removeClass('fixed')
      .addClass('dark-bg');
  }
}

// Window scroll function
$(window).scroll(() => {
  sticky();
});

