$(document).on('keypress', 'input.phone', event => {
  // if (e.which !== 8 && e.which !== 0 && (e.which < 48 || e.which > 57)) {
  //   e.preventDefault();
  // }
  const regex = new RegExp('^[0-9-!+*?]');
  const key = String.fromCharCode(event.charCode ? event.which : event.charCode);
  if (!regex.test(key)) {
    event.preventDefault();
    return false;
  }
});

